		<ul>
			<li><Link to={"/products/p1"}>Book is {value}</Link></li>
			<li><Link to={"/products/p2"}>Carpet</Link></li>
			<li><Link to={"/products/p3"}>Online Course</Link></li>			
		</ul>
	</section>
};

export default Products;
